object Solution {
    def minProcessingTime(processorTime: List[Int], tasks: List[Int]): Int = {
        val sortedProcessorTime = processorTime.sorted
        val sortedTasks = tasks.sorted(Ordering.Int.reverse)

        sortedProcessorTime.zipWithIndex.map { case (startTime, processorIndex) =>
            val taskTimes = sortedTasks.grouped(sortedProcessorTime.length * 4 / sortedProcessorTime.length).toList
            val tasksForProcessor = taskTimes(processorIndex)
            tasksForProcessor.map(taskTime => taskTime + startTime).max
        }.max
    }
}
